import React, {Component} from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import CreateTodosList from './components/CreateTodosList';
import EditTodos from './components/EditTodos';
import TodosList from './components/TodosList';
import logo from './logo.svg'


class App extends Component {
  render(){
    return(
      <Router>
      <div className='container'>

            <nav className='navabar navbar-expand-lg navbar-light bg-light'>
          <a className ='navbar-brand' href='https://codingthesmartway.com' target='_blank'>
        <img src={logo} width ='30' height='30' alt ='CodingTheSmartWay.com' />
      </a>

      <Link to='/' className = 'nav-brand'>MERN TODO APP</Link>



      <div className ='collapse '>

        <ul className =' navbar-nav mr-auto'>

          <li className='navbar-item'>
          <Link to='/' className='nav-link'>Todos</Link>
          </li>

          <li className='navbar-item'>
          <Link to='/create' className='nav-link'>Create Todos</Link>
          </li>

        </ul>

      </div>

      </nav>



      <Route path='/' exact component={TodosList}  />
      <Route path='/edit/:id' component={EditTodos} />
      <Route path='/create' component={CreateTodosList} />
      </div>
      </Router>
    )
  }
}

export default App;
